DROP TABLE IF EXISTS movies;
CREATE TABLE movies(id INTEGER PRIMARY KEY, title VARCHAR(30) NOT NULL, year INTEGER CHECK(year <= strftime("%Y") and year >= 1900 or year = 0));

BEGIN;
commit;

DROP TABLE IF EXISTS genres;
CREATE TABLE genres(id INTEGER PRIMARY KEY, genre VARCHAR(30) NOT NULL);

BEGIN;
commit;

DROP TABLE IF EXISTS movies_genres;
CREATE TABLE movies_genres(movie_id INTEGER, genre_id INTEGER, FOREIGN KEY (movie_id) REFERENCES movies(id) ON DELETE CASCADE, FOREIGN KEY (genre_id) REFERENCES genres(id));

BEGIN;
commit;

DROP TABLE IF EXISTS users;
CREATE TABLE users(id INTEGER PRIMARY KEY, name VARCHAR(30) NOT NULL,  surname VARCHAR(30) NOT NULL, email VARCHAR NOT NULL check(instr(email, "@") > 0 ),  gender VARCHAR(30) NOT NULL, register_date VARCHAR NOT NULL check(register_date>="2005-01-02"));

BEGIN;
commit;

DROP TABLE IF EXISTS occupations;
CREATE TABLE occupations(id INTEGER PRIMARY KEY, occupation VARCHAR NOT NULL);

BEGIN;
commit;

DROP TABLE IF EXISTS users_occupations;
CREATE TABLE users_occupations(users_id INTEGER, occupation_id INTEGER, FOREIGN KEY (users_id) REFERENCES users(id) ON DELETE CASCADE,  FOREIGN KEY (occupation_id) REFERENCES occupations(id));

BEGIN;
commit;



DROP TABLE IF EXISTS tags;
CREATE TABLE tags(id INTEGER PRIMARY KEY, users_id INTEGER, movie_id INTEGER, tag VARCHAR(20) not null, timestamp1 INTEGER not null, FOREIGN KEY (users_id) REFERENCES users(id) ON DELETE CASCADE, FOREIGN KEY (movie_id) REFERENCES movies(id) ON DELETE CASCADE);
BEGIN;
commit;



DROP TABLE IF EXISTS ratings;
CREATE TABLE ratings(id INTEGER PRIMARY KEY, users_id INTEGER, movie_id INTEGER, rating INTEGER default 0, timestamp INTEGER not null, FOREIGN KEY (users_id) REFERENCES users(id) ON DELETE CASCADE, FOREIGN KEY (movie_id) REFERENCES movies(id) ON DELETE CASCADE);
BEGIN;
commit;

CREATE INDEX index_movie_year ON movies (year);
CREATE INDEX index_movie_title ON movies (title);
CREATE INDEX index_users_surname ON users (surname);
